  // Amennyiben a +t√°phoz csatlakoztattuk, akkor √≠gy m√≥dosul a nyom√≥gombok √°llapot√°nak a beolvas√°sa:
  //bool reading1 = digitalRead(button1Pin); // Olvassuk be az 1. nyom√≥gomb √°llapot√°t
  //bool reading2 = digitalRead(button2Pin); // Olvassuk be a 2. nyom√≥gomb √°llapot√°t

  // Ha a gomb √°llapota v√°ltozott
  if (reading1 != lastButton1State) {
    // Friss√≠tj√ºk a prellmentes id≈ëtartam kezdeti idej√©t
    lastDebounceTime1 = millis();
  }

  // Ellen≈ërizz√ºk, hogy a gomb √°llapota stabil-e a prellmentes id≈ë ut√°n
  if ((millis() - lastDebounceTime1) > debounceDelay) {
    // Ha igen, akkor friss√≠tj√ºk a gomb √°llapot√°t
    if (reading1 != button1State) {
      button1State = reading1;

