char* read(const char* filename){
    FILE* f = fopen(filename, "rb");
    if (f == NULL){
        printf("file %s is not found or missing!", filename);
		exit(1);
    }
    fseek(f, 0L, SEEK_END);
    long size = ftell(f)+1;
    fclose(f);
    f = fopen(filename, "r");
    void* content = memset(malloc(size), '\0', size);
    fread(content, 1, size-1, f);
    fclose(f);
    return (char*) content;
}

