const ll maxn = 3e5 + 3;
ll now = 0;
vl hit(maxn);
ll dict[maxn][26];

void insert(const string &str)
{
    ll u = 0;
    for (auto c : str) {
        ll offset = c - 'a';
        if (dict[u][offset] == 0)
            dict[u][offset] = ++now;
        u = dict[u][offset];
        hit[u] += 1;
    }
}
ll get(const string &str)
{
    ll u = 0, ret = 0;
    for (auto c : str) {
        ll offset = c - 'a';
        if (dict[u][offset] == 0)
            return ret;
        u = dict[u][offset];
        ret += hit[u];
    }
    return ret;
}

