def main(m, z, a, n):
    result1 = sum([45 + z ** 3 + 63 * k + 1 for k in range(1, m + 1)])
    result2 = sum([j ** 4 + (38 * k ** 3 - 9 * c) ** 5 +
                   98 * c for j in range(1, n + 1) for c in range(1, a + 1)
                   for k in range(1, m + 1)])
    result = result2 + result1
    return float('{:.2e}'.format(result))

def main(m, z, a, n):
    result1 = 0
    result2 = 0
    for k in range(1, m + 1):
        result1 += 45 + z ** 3 + 63 * k + 1
    for j in range(1, n + 1):
        for c in range(1, a + 1):
            for k in range(1, m + 1):
                result2 += j ** 4 + (38 * k ** 3 - 9 * c) ** 5 + 98 * c
    result = result2 + result1
    result = float('{:.2e}'.format(result))
    return result

class FigureTab
{
    friend ostream& operator<<(ostream& os, const FigureTab& ob);
    int dlugosc;
    Figure **tab;
public:
    FigureTab(int dl=0) : dlugosc(dl)  //konstruktor
    {
        if (dlugosc>0)
        {
            tab = new Figure *[dlugosc] { nullptr };
        }
        else
        {
            dlugosc=0;
            tab=nullptr;
        }
    }

    ~FigureTab()
    {
        cout << endl << "destruktor FigureTab zadzialal " << endl;
        for (int i=0; i<dlugosc; i++)
        {
            delete tab[i];
        }
        delete[] tab;
    }

    void dodajFigure(Figure* nowa);
    void usunWszystko();
    Figure*& operator[](int index) { return tab[index - 1]; }
};

void FigureTab::dodajFigure(Figure* nowa) {
    if (tab == nullptr) {   // tablica nie istnieje
        tab = new Figure * [1];
        tab[0] = nowa;
    }
    else {
        // tymczasowa tablica do przechowania dotychczasowej
        Figure** temp = new Figure * [dlugosc + 1];
        // przepisanie element√≥w z dotychczasowej tablicy do tymczasowo stworzonej
        for (int i{ 0 }; i < dlugosc; ++i) {
            temp[i] = tab[i];
        }
        delete[] tab;
        temp[dlugosc] = nowa;
        tab = temp;
    }
    ++dlugosc;
}

void FigureTab::usunWszystko() {
    for (int i{}; i < dlugosc; ++i) {
        delete tab[i];
    }
    delete[] tab;
    tab = nullptr;
    dlugosc = 0;
}

ostream& operator<<(ostream& os, const FigureTab& ob) {
    if (ob.dlugosc == 0) {
        os << "Empty tab";
    }
    else {
        for (auto i{1}; i <= ob.dlugosc; ++i) {
            os << ob[i]->print() << '\t';
        }
    }
    return os;
}

